import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { signupUser } from '../services/api';
import '../styles/Auth.css';

function Signup() {
  const [formData, setFormData] = useState({
    email: '',
    username: '',
    password1: '',
    password2: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    
    // Validate passwords match
    if (formData.password1 !== formData.password2) {
      setError('Passwords do not match');
      return;
    }
    
    setLoading(true);

    try {
      // Format data to match what the backend expects
      const signupData = {
        email: formData.email,
        username: formData.username,
        fullName: formData.username, // Using username as fullName, change if needed
        password: formData.password1
      };
      
      console.log('Sending signup data:', signupData);
      
      // Call signup API
      const response = await signupUser(signupData);
      
      console.log('Signup successful:', response);
      
      // Redirect to login
      navigate('/login', { 
        state: { message: 'Account created successfully! Please log in.' } 
      });
      
    } catch (error) {
      console.error('Signup error:', error);
      setError(error.message || 'Registration failed. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <section className="auth-section">
      <div className="max-w-md mx-auto bg-white p-8 rounded-lg shadow-md">
        <h2 className="text-2xl font-semibold text-gray-800 mb-6 text-center">Sign Up</h2>
        
        <form onSubmit={handleSubmit} className="auth-form">
          <div className="form-group">
            <label htmlFor="email">Email:</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              placeholder="Enter your email"
              required
              className="w-full p-3 border border-gray-300 rounded"
            />
          </div>

          <div className="form-group">
            <label htmlFor="username">Username:</label>
            <input
              type="text"
              id="username"
              name="username"
              value={formData.username}
              onChange={handleChange}
              placeholder="Enter your username"
              required
              className="w-full p-3 border border-gray-300 rounded"
            />
          </div>

          <div className="form-group">
            <label htmlFor="password1">Password:</label>
            <input
              type="password"
              id="password1"
              name="password1"
              value={formData.password1}
              onChange={handleChange}
              placeholder="Enter your password"
              required
              className="w-full p-3 border border-gray-300 rounded"
            />
          </div>

          <div className="form-group">
            <label htmlFor="password2">Confirm Password:</label>
            <input
              type="password"
              id="password2"
              name="password2"
              value={formData.password2}
              onChange={handleChange}
              placeholder="Enter your password again"
              required
              className="w-full p-3 border border-gray-300 rounded"
            />
          </div>

          {error && (
            <div className="error-message mb-4">
              <p className="text-red-600 text-sm">{error}</p>
            </div>
          )}

          <button
            type="submit"
            disabled={loading}
            className={`w-full bg-green-600 text-white py-3 rounded-lg text-lg font-semibold hover:bg-green-700 transition ${
              loading ? 'opacity-70 cursor-not-allowed' : ''
            }`}
          >
            {loading ? 'Creating Account...' : 'Sign Up'}
          </button>
        </form>

        <p className="text-center mt-4">
          Already have an account?
          <Link to="/login" className="text-green-600 hover:underline ml-1">
            Login
          </Link>
        </p>
      </div>
    </section>
  );
}

export default Signup;
